from django.db import modelsfrom apps.account.models import Accountfrom apps.account.models.patients import PatientModelfrom apps.logus.models import ServiceModel, BookedRoomModel, RoomModelclass BookingModel(models.Model):    patient = models.ForeignKey(PatientModel, on_delete=models.CASCADE, related_name='bookings')    booked_room = models.ForeignKey(BookedRoomModel, on_delete=models.CASCADE)    guests_number = models.IntegerField()    created_by = models.ForeignKey(Account, related_name="booking", on_delete=models.SET_NULL, null=True)    created_at = models.DateTimeField(auto_now_add=True)    modified_at = models.DateTimeField(auto_now=True)    modified_by = models.ForeignKey(Account, related_name="modf_booking", on_delete=models.SET_NULL, null=True)    def __str__(self):        return f"{self.booked_room} - {self.patient}"